import React, { useEffect, useState } from 'react'
import axios from 'axios'
import Header from './Header'
import Footer from './Footer'
// import Carousel from 'react-grid-carousel'
import { Carousel } from 'react-responsive-carousel';
import lahanga from './lahanga.json'
import { useNavigate } from 'react-router-dom'

function Home() {
  useEffect(()=>{getLahangadata(); window.scrollTo(0,0)},[])
  const navigate = useNavigate()
  const[ lahangaData, setLahangaData ] = useState([])
  

  const getLahangadata=()=>{
    axios.get("http://checkmycurriculumvitae.com/api/lahanga").then((res)=>setLahangaData(res.data.data))
  }
  return (
    <div>
        <Header/>
        <Carousel>
                <div>
                    <img src="assets/1.jpeg" />
                    {/* <p className="legend">Legend 1</p> */}
                </div>
                <div>
                    <img src="assets/2.jpeg" />
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="assets/3.jpeg" />
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
        {/* <Carousel cols={1} rows={1} gap={0} autoplay={4000} loop arrowLeft arrowRight >
          <Carousel.Item>
            <img   src="https://cdn.shopify.com/s/files/1/0535/5182/5079/files/swish_ethereal_desktop_1512x.jpg?v=1674584495" />
          </Carousel.Item>
          <Carousel.Item>
            <img src="https://cdn.shopify.com/s/files/1/0535/5182/5079/files/co-ord_banner_d_1512x.jpg?v=1675786364" />
          </Carousel.Item>
         </Carousel> */}
            <div style={{width:"100%", textAlign:"center",marginTop:"2%"}}>
              <label style={{fontSize:25, }}>NEW ARRIVALS</label>
              <div style={{width:"90%", marginLeft:"5%", display:"flex", flexWrap:"wrap", justifyContent:"space-between"}}>
                {lahangaData.map((i,n)=>{
                  if(n<8){
                    return(
                <div className="products"
                onClick={()=>{navigate("/ProductView"); localStorage.setItem("productdata",JSON.stringify(i))}}>
                  <div style={{width:"100%", height:"88%"}}>
                    <img src={i.thumbnailImage} style={{width:"100%", height:"100%"}}/>
                  </div>
                  <label>{i.brand}</label><br/>
                  <label style={{fontWeight:"bold"}}>Rs.{i.price.value}</label>
                </div>)}
            })}
              </div>
            </div>
            <div style={{width:"100%", textAlign:"center", marginTop:"2%", marginBottom:"2%"}}>
              <label style={{fontSize:25, }}>COORDINATE</label>
              <div style={{width:"90%", marginLeft:"5%", display:"flex", flexWrap:"wrap", justifyContent:"space-between"}}>
                {lahangaData.map((i,n)=>{
                  if(n>7&n<12){
                    return(
                <div className="products" 
                onClick={()=>{navigate("/ProductView"); localStorage.setItem("productdata",JSON.stringify(i))}}>
                  <div style={{width:"100%", height:"88%"}}>
                    <img src={i.thumbnailImage} style={{width:"100%", height:"100%"}}/>
                  </div>
                  <label>{i.brand}</label><br/>
                  <label style={{fontWeight:"bold"}}>Rs.{i.price.value}</label>
                </div>)}
            })}
              </div>
            </div>
            <div style={{width:"100%", textAlign:"center", marginTop:"2%", marginBottom:"2%"}}>
              <label style={{fontSize:25, }}>SAREES</label>
              <div style={{width:"90%", marginLeft:"5%", display:"flex", flexWrap:"wrap", justifyContent:"space-between"}}>
                {lahangaData.map((i,n)=>{
                  if(n>13&n<18){
                    return(
                <div className="products" 
                onClick={()=>{navigate("/ProductView"); localStorage.setItem("productdata",JSON.stringify(i))}}>
                  <div style={{width:"100%", height:"88%"}}>
                    <img src={i.thumbnailImage} style={{width:"100%", height:"100%"}}/>
                  </div>
                  <label>{i.brand}</label><br/>
                  <label style={{fontWeight:"bold"}}>Rs.{i.price.value}</label>
                </div>)}
            })}
              </div>

            </div>
            <div style={{width:"100%", textAlign:"center", marginTop:"2%", marginBottom:"2%"}}>
              <label style={{fontSize:25, }}>BESTSELLER</label>
              <div style={{width:"90%", marginLeft:"5%", display:"flex", flexWrap:"wrap", justifyContent:"space-between"}}>
                {lahangaData.map((i,n)=>{
                  if(n>18&n<27){
                    return(
                <div className="products" 
                onClick={()=>{navigate("/ProductView"); localStorage.setItem("productdata",JSON.stringify(i))}}>
                  <div style={{width:"100%", height:"88%"}}>
                    <img src={i.thumbnailImage} style={{width:"100%", height:"100%"}}/>
                  </div>
                  <label>{i.brand}</label><br/>
                  <label style={{fontWeight:"bold"}}>Rs.{i.price.value}</label>
                </div>)}
            })}
              </div>

            </div>
            <div style={{width:"100%", textAlign:"center", marginTop:"2%", marginBottom:"2%"}}>
              <label style={{fontSize:25, }}>ANARKALI</label>
              <div style={{width:"90%", marginLeft:"5%", display:"flex", flexWrap:"wrap", justifyContent:"space-between"}}>
                {lahangaData.map((i,n)=>{
                  if(n>28&n<33){
                    return(
                <div className="products" 
                onClick={()=>{navigate("/ProductView"); localStorage.setItem("productdata",JSON.stringify(i))}}>
                  <div style={{width:"100%", height:"88%"}}>
